import { ColorsType } from 'types/tailwindcss'
import { lighten } from 'polished'
import theme from 'styles/theme'

interface IconsProps {
  size?: number | string
  className?: string
  type?: boolean
  color?: ColorsType | 'transparent'
}

function getColor(color: ColorsType | 'transparent') {
  let fColor = ''

  switch (color) {
    case 'black':
      fColor = theme.colors.blue[400]
      break
    case 'white':
      fColor = theme.colors.blue[400]
      break
    case 'transparent':
      fColor = 'transparent'
      break
    default:
      fColor = theme.colors[color][400]
      break
  }

  return fColor
}

